import { fName, lName } from "./demo1";

const ComC = () =>{
    return (
    <>
    <fName.Consumer>{(fname) => {
        return (
            <lName.Consumer> {(lname) => {
                return (<h1>Hello {fname} {lName}</h1>);
            }}
            </lName.Consumer>
        )
        
    }}
    </fName.Consumer>
    </>
    );
}

export default ComC;
